import "./style.css";
import image1 from "../../assets/slider/17-01-14 Niebla1677.jpg";
import image2 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image3 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image4 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image5 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image6 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image7 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image8 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image9 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image10 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image11 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import image12 from "../../assets/slider/2022_6_15_Ariadna_0786.jpg";
import { motion } from "framer-motion";

const Slider = () => {
  const imageArray = [
    image1,
    image2,
    image3,
    image4,
    image5,
    image6,
    image7,
    image8,
    image9,
    image10,
    image11,
    image12,
  ];
  return (
    <motion.section className="slidercontainer">
      <motion.div className="slider" drag="x">
        {imageArray.map((image, index) => {
          return (
            <motion.div key={index} className="imageslide">
              <img src={image} alt={image}></img>
            </motion.div>
          );
        })}
      </motion.div>
    </motion.section>
  );
};
export default Slider;
